  @override
  String get settings_AboutUsText => 'Deze applicatie is ontwikkeld door de vereniging MAWAQIT.\n\nDe vereniging MAWAQIT is een non-profitorganisatie die in 2021 in Frankrijk is opgericht.\nOns doel is de ontwikkeling van innovatieve oplossingen met betrekking tot IT en digitale technologie zoals software en websites; lesgeven en trainen in digitale oplossingen en IT-tools.\n\nHet MAWAQIT-ecosysteem is ons vlaggenschipproduct en het verhaal begon in 2016, met een applicatie op grote schermen voor moskeeën, vervolgens een mobiele app, een thuisassistent-add-on en een alexa-vaardigheid, enz.\n\nMAWAQIT biedt je een nieuwe manier om gebedstijden bij te houden en te beheren, in feite bieden we een end-to-end-systeem dat moskeemanagers een online tool biedt die 24 uur per dag beschikbaar is, waardoor ze tijdschema\'s, nieuws en informatie kunnen beheren. De moskee en vele andere functies. De gelovigen profiteren daarentegen van een mobiele applicatie waarmee ze de exacte en niet-geschatte dienstregelingen van hun favoriete moskee kunnen raadplegen, evenals het nieuws en andere functies, zoals het zoeken naar een moskee op geolocatie, de adhan , de qibla. ... enz. We hebben betrouwbaarheid en kwaliteit tot onze belangrijkste waarden gemaakt. Onze ambitie is duidelijk: de beste service voor onze moskeeën bouwen dankzij technologie en design.\n\nAls je deze applicatie leuk vond, geef dan je mening over de winkel.';

